import React from 'react';
import s from './CraftframeShop.module.css';
import Slider from 'react-slick';
import img1 from '../../../src/images/craftframeShop/1.png'
import img2 from '../../../src/images/craftframeShop/2.png'
import img3 from '../../../src/images/craftframeShop/3.png'
import { useHistory, NavLink } from 'react-router-dom';
const CraftframeShop = ()=>{
    let settings = {
        dots:false,
        infinite:false,
        slideToShow:1,
        slideToScroll:1,
        arrows:false,
        centerMode:true,
        centerPadding:'65px',
    }

    const history = useHistory();

    const expandWindow =()=>{
        history.push('/craftframeShop/boxComposition')
    }
    return(
<div className={s.craftframeShop}>
<Slider {...settings} className={s.cfraftframeShopSlider}>
<div className={s.cfraftframeShopSlide}><img src={img1}></img><p onClick={()=>expandWindow()}className={s.whatIsInsideBtn}>Что внутри?</p></div>
<div className={s.cfraftframeShopSlide}><img src={img2}></img></div>
<div className={s.cfraftframeShopSlide}><img src={img3}></img></div>
</Slider>
</div>
    );
};

export default CraftframeShop;
